Mafalda Vasconcelos is a South African artist who grew up in Mozambique and is currently based in Melbourne, Australia. üá≤üáø üá¶üá∫ ‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä
‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä
For Mafalda, art is her way of exploring her biracial identity and all the various cultural influences she has in her life. Mafalda's inspiration for her art comes from the symbolism and spiritualism used in Mozambican culture. The figures shown in her work are based on souls rather than real human figures. The figures represent Mafalda's ancestors from the Nharinga people of Mozambique. üë§ üåé ‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä
‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä
The figures in Mafalda's are often dark in colour and they portray the African women who raised her and inspire her every day. The shapes and patterns used in her artwork are part of the language that Mafalda has developed by looking at visual elements in African art and in her own life. ‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä
